class Navbar extends Component{
    render(){
        return (
<nav style={{background:'black',height:'50px'}}>
<a style={{color:'yellow'}}>DECENTRALIZED BANK</a>
<ui>
<li>
<small style={{color:'white'}}>ACCOUNT NUMBERS</small>
</li>
</ui>
</nav>
      )  
    }
}
export default Navbar;
